// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;

contract DataStorageSystem {
    struct Data {
        address owner;
        bytes32 dataHash;
    }

    mapping(uint256 => Data) private dataMap;
    uint256 private dataCounter;

    event DataStored(uint256 indexed id, address indexed owner, bytes32 dataHash);
    event DataTransferred(uint256 indexed id, address indexed from, address indexed to);

    function storeData(bytes32 _dataHash) external {
        dataMap[dataCounter] = Data(msg.sender, _dataHash);
        emit DataStored(dataCounter, msg.sender, _dataHash);
        dataCounter++;
    }

    function getData(uint256 _id) external view returns (address owner, bytes32 dataHash) {
        require(_id < dataCounter, "Invalid data ID");
        Data memory data = dataMap[_id];
        return (data.owner, data.dataHash);
    }

    function transferData(uint256 _id, address _to) external {
        require(_id < dataCounter, "Invalid data ID");
        require(msg.sender == dataMap[_id].owner, "Only the owner can transfer the data");

        dataMap[_id].owner = _to;
        emit DataTransferred(_id, msg.sender, _to);
    }
}

